import React from 'react'

// 文章数据可以来自 props 或 API
const articleData = {
  title: 'React 的美',
  author: 'Jane Doe',
  content: `
    React 使创建交互式 UI 变得轻而易举。为应用的每个状态设计简单的视图，
    当你的数据变化时，React 将高效地更新和渲染恰当的组件。

    声明式视图使你的代码更可预测，更易于调试。基于组件的架构让你可以灵活地在应用中传递丰富的数据，
    并将状态保持在 DOM 之外。
  `,
}

export default function Article () {
  return (
    <div className="article">
      <h1>{articleData.title}</h1>
      <p className="author">作者 {articleData.author}</p>
      <div className="content">{articleData.content}</div>
    </div>
  )
}
